(function(){var loadHandler=window['sl_{D6ED4975-1042-491C-AA53-2C8DF54D660A}'];loadHandler&&loadHandler(6, '<div id="spr0_95effcc"><div id="spr1_95effcc" class="kern slide"><img id="img3_95effcc" src="data:image/png;base64," width="1280px" height="720px" alt="" style="left:0px;top:0px;"/><div id="spr3_95effcc" style="left:986.15px;top:662.674px;"><div id="spr4_95effcc"><img id="img0_95effcc" src="data:image/png;base64," width="273.75" height="48" alt="" style="left:0.06px;top:-0.065px;"/></div></div></div><div id="spr2_95effcc" class="kern slide"><div id="svg0_95effcc" style="left:1090.913px;top:635.56px;"><svg width="168" height="38" viewBox="0 0 168 38"><path fill="#e2f0d9" d="M0,0 h167.04 v37.44 h-167.04 Z"/></svg></div><div id="spr5_95effcc" style="left:1090.913px;top:635.56px;"><div style="width:0px;"><span id="txt0_95effcc" class="relpos" data-width="74.242188" style="left:9.6px;top:1.933px;">Book B  </span> <span id="txt1_95effcc" class="relpos" data-width="73.511719" style="left:9.593px;top:1.933px;">Page 24</span></div></div><div id="spr6_95effcc" style="left:80.147px;"><div id="spr7_95effcc"><img id="img1_95effcc" src="data:image/png;base64," width="1005.75" height="72.75" alt="" style="left:-0.06px;top:0.061px;"/></div></div><div id="spr8_95effcc" style="left:80.147px;top:86.737px;"><div style="width:0px;"><span id="txt2_95effcc" data-width="609.761719" style="left:9.6px;top:3.527px;">When a cell is not dividing, its genetic material consists of</span></div><div style="width:0px;"><span id="txt3_95effcc" data-width="557.671875" style="left:9.6px;top:36.36px;">long, thin, decondensed DNA called chromatin. After</span></div><div style="width:0px;"><span id="txt4_95effcc" data-width="601.757812" style="left:9.6px;top:69.193px;">DNA replication, the single-stranded chromatin becomes</span></div><div style="width:0px;"><span id="txt5_95effcc" data-width="182.320312" style="left:9.6px;top:102.027px;">double-stranded.</span></div></div><div id="spr9_95effcc" style="left:80.147px;top:86.737px;"><div style="width:0px;"><span id="txt6_95effcc" class="nokern relpos" dir="auto" style="left:9.6px;top:145.306px;">•</span> <span id="txt7_95effcc" class="relpos" data-width="545.378906" style="left:31.198px;top:141.527px;">During cell division, the double-stranded chromatin</span></div><div style="width:0px;"><span id="txt8_95effcc" data-width="487.617188" style="left:39.6px;top:174.36px;">condenses into thick, shortened strands called</span></div><div style="width:0px;"><span id="txt9_95effcc" class="relpos" data-width="157.605469" style="left:39.6px;top:207.193px;">chromosomes</span> <span id="txt10_95effcc" class="relpos" style="left:39.593px;top:207.193px;">.</span></div></div><div id="spr10_95effcc" style="left:80.147px;top:86.737px;"><div style="width:0px;"><span id="txt11_95effcc" class="nokern relpos" dir="auto" style="left:9.6px;top:250.473px;">•</span> <span id="txt12_95effcc" class="relpos" data-width="237.527344" style="left:31.198px;top:246.693px;">Consist of two “sister” </span> <span id="txt13_95effcc" class="relpos" data-width="133.289062" style="left:31.191px;top:246.693px;">chromatids </span> <span id="txt14_95effcc" class="relpos" data-width="98.250000" style="left:31.184px;top:246.693px;">joined by</span></div><div style="width:0px;"><span id="txt15_95effcc" data-width="127.078125" style="left:39.6px;top:279.527px;">centromere.</span></div></div><div id="spr11_95effcc" style="left:80.147px;top:86.737px;"><div style="width:0px;"><span id="txt16_95effcc" class="relpos" data-width="40.988441" style="left:9.6px;top:312.36px;">     </span> <span id="txt17_95effcc" class="relpos" data-width="434.703278" style="left:9.593px;top:312.36px;">Are sister chromatids similar or identical?</span></div></div><div id="spr12_95effcc" style="left:80.147px;top:86.737px;"><div style="width:0px;"><span id="txt18_95effcc" class="nokern relpos" dir="auto" style="left:9.6px;top:355.639px;">•</span> <span id="txt19_95effcc" class="relpos" data-width="261.468750" style="left:31.198px;top:351.86px;">To count chromosomes, </span> <span id="txt20_95effcc" class="relpos" data-width="199.078125" style="left:31.191px;top:351.86px;">count centromeres</span> <span id="txt21_95effcc" class="relpos" style="left:31.184px;top:351.86px;">.</span></div></div><div id="spr13_95effcc" style="left:770.79px;top:76.835px;"><div id="spr14_95effcc"><img id="img2_95effcc" src="data:image/jpeg;base64," width="421.5" height="558.75" alt="" style="left:0.129px;top:-0.01px;"/></div></div><div id="svg1_95effcc" style="left:38.126px;top:506.545px;"><svg width="730" height="102" viewBox="0 0 730 102"><path fill="#e6faf7" d="M0,0 h729.266 v101.084 h-729.266 Z"/></svg></div><div id="spr15_95effcc" style="left:38.126px;top:506.545px;"><div style="width:0px;"><span id="txt22_95effcc" class="relpos" data-width="131.949219" style="left:9.6px;top:3.767px;">When a cell is </span> <span id="txt23_95effcc" class="relpos" data-width="111.994141" style="left:9.593px;top:3.767px;">not dividing</span> <span id="txt24_95effcc" class="relpos" data-width="321.981750" style="left:9.587px;top:3.767px;">, its DNA exists as long, thread-like </span> <span id="txt25_95effcc" class="relpos" data-width="97.108070" style="left:9.58px;top:3.767px;">chromatin</span> <span id="txt26_95effcc" class="relpos" data-width="28.045572" style="left:9.573px;top:3.767px;"> - a</span></div><div style="width:0px;"><span id="txt27_95effcc" data-width="674.742798" style="left:9.6px;top:34.5px;">form that allows genes to be easily accessed for protein synthesis. Before</span></div><div style="width:0px;"><span id="txt28_95effcc" class="relpos" data-width="166.768219" style="left:9.6px;top:65.233px;">division, this DNA </span> <span id="txt29_95effcc" class="relpos" data-width="91.751297" style="left:9.593px;top:65.233px;">replicates</span> <span id="txt30_95effcc" class="relpos" data-width="407.723297" style="left:9.587px;top:65.233px;"> during interphase, creating identical copies.</span></div></div><div id="svg2_95effcc" style="left:38.126px;top:502.912px;"><svg width="730" height="102" viewBox="0 0 730 102"><path fill="#e6faf7" d="M0,0 h729.266 v101.084 h-729.266 Z"/></svg></div><div id="spr16_95effcc" style="left:38.126px;top:502.912px;"><div style="width:0px;"><span id="txt31_95effcc" class="relpos" data-width="273.460938" style="left:9.6px;top:3.767px;">As division begins, chromatin </span> <span id="txt32_95effcc" class="relpos" data-width="99.067055" style="left:9.593px;top:3.767px;">condenses</span> <span id="txt33_95effcc" class="relpos" data-width="109.924477" style="left:9.587px;top:3.767px;"> into visible </span> <span id="txt34_95effcc" class="relpos" data-width="132.635406" style="left:9.58px;top:3.767px;">chromosomes</span> <span id="txt35_95effcc" class="relpos" data-width="54.408852" style="left:9.573px;top:3.767px;">, each</span></div><div style="width:0px;"><span id="txt36_95effcc" class="relpos" data-width="206.003250" style="left:9.6px;top:34.5px;">made of two identical </span> <span id="txt37_95effcc" class="relpos" data-width="162.252594" style="left:9.593px;top:34.5px;">sister chromatids</span> <span id="txt38_95effcc" class="relpos" data-width="330.902344" style="left:9.587px;top:34.5px;"> joined at a central region called the</span></div><div style="width:0px;"><span id="txt39_95effcc" class="relpos" data-width="110.477859" style="left:9.6px;top:65.233px;">centromere</span> <span id="txt40_95effcc" class="relpos" data-width="11.444010" style="left:9.593px;top:65.233px;">..</span></div></div><div id="svg3_95effcc" style="left:38.126px;top:502.899px;"><svg width="730" height="71" viewBox="0 0 730 71"><path fill="#e6faf7" d="M0,0 h729.266 v70.051 h-729.266 Z"/></svg></div><div id="spr17_95effcc" style="left:38.126px;top:502.899px;"><div style="width:0px;"><span id="txt41_95effcc" class="relpos" data-width="31.122395" style="left:9.6px;top:1.902px;">👉</span> <span id="txt42_95effcc" class="relpos" data-width="33.247395" style="left:9.593px;top:3.767px;"> To </span> <span id="txt43_95effcc" class="relpos" data-width="191.615234" style="left:9.587px;top:3.767px;">count chromosomes</span> <span id="txt44_95effcc" class="relpos" data-width="197.292969" style="left:9.58px;top:3.767px;">, biologists count the </span> <span id="txt45_95effcc" class="relpos" data-width="136.708328" style="left:9.573px;top:3.767px;">centromeres - </span> <span id="txt46_95effcc" class="relpos" data-width="67.358070" style="left:9.567px;top:3.767px;">not the</span></div><div style="width:0px;"><span id="txt47_95effcc" data-width="109.603516" style="left:9.6px;top:34.5px;">chromatids.</span></div></div><div id="svg4_95effcc" style="left:38.126px;top:587.901px;"><svg width="730" height="71" viewBox="0 0 730 71"><path fill="#e6faf7" d="M0,0 h729.266 v70.051 h-729.266 Z"/></svg></div><div id="spr18_95effcc" style="left:38.126px;top:587.901px;"><div style="width:0px;"><span id="txt48_95effcc" class="relpos" data-width="448.382507" style="left:9.6px;top:3.767px;">For example, a duplicated chromosome still has </span> <span id="txt49_95effcc" class="relpos" data-width="156.394241" style="left:9.593px;top:3.767px;">one centromere</span> <span id="txt50_95effcc" class="relpos" data-width="122.615601" style="left:9.587px;top:3.767px;">, so it counts</span></div><div style="width:0px;"><span id="txt51_95effcc" class="relpos" data-width="33.155315" style="left:9.6px;top:34.5px;">as </span> <span id="txt52_95effcc" class="relpos" data-width="169.343460" style="left:9.593px;top:34.5px;">one chromosome</span> <span id="txt53_95effcc" class="relpos" data-width="193.006226" style="left:9.587px;top:34.5px;">, even though it has </span> <span id="txt54_95effcc" class="relpos" data-width="155.099319" style="left:9.58px;top:34.5px;">two chromatids</span> <span id="txt55_95effcc" class="relpos" style="left:9.573px;top:34.5px;">.</span></div></div><div id="spr19_95effcc" style="left:1224.769px;"><div id="svg5_95effcc" style="left:5.031px;top:4.251px;"><svg width="47" height="28" viewBox="0 0 47 28"><path fill="#c00000" d="M0,0 h46.08 v27.429 h-46.08 Z"/></svg></div><div id="svg6_95effcc" style="left:0px;top:0px;"><svg width="65" height="28" viewBox="0 0 65 28"><path fill="none" d="M0,0 h64.174 v27.433 h-64.174 Z"/></svg></div><div id="spr20_95effcc"><div style="width:0px;"><span id="txt56_95effcc" data-width="42.155083" style="left:9.598px;top:2.268px;">END</span></div></div></div></div></div>', '{"s":[]}');})();